import React from 'react';

const Tour =({price, image, id, name, info})=> {
    return (
        <div id={id} className="tour-card">
            <img src={image} alt="" />
            <div className="description">
                <h3 className="tittle">{name}</h3>
                <span className="price">{price}</span>
            </div>
            <p>{info}</p>
        </div>
    )
}

export default Tour
